import React, { useState } from "react";
import axios from "axios";
/* components */
import Error from "../components/Error";
import MyInput from "../components/MyInput";
import MainSecondHeder from "../components/MainSecoundHeder";
import Button from "../components/Button";
export default function AddEmployee() {
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [firstName, setFirstName] = useState("")
    const [repPassword, setRepPassword] = useState("");
    const [phoneNumber, setPhoneNumber] = useState("");
    const [error, setError] = useState("");
    const [isMyInputErrorPhoneNumber, setMyInputErrorPhoneNumber] = useState(false);
    const [isMyInputErrorEmail, setMyInputErrorEmail] = useState(false);
    const [isMyInputErrorPassword, setMyInputErrorPassword] = useState(false)
    const [isMyInputError, setMyInputError] = useState(false);
    const role = "employee";

    const registrationEmployee = () => {
        let info = <Error>Popraw b≈Çedy aby dodaƒá pracownika</Error>
        if (isMyInputError === true || !firstName || !phoneNumber || !email || !password || !repPassword) {
            setMyInputError(true);
            setError(info);
        } else {
            axios.post("http://127.0.0.1:8080/user/check-email-uniqueness", { email })
                .then((res) => {
                    if (res.data.exists) {
                        setError(<Error> Adres email figuruje ju≈º w bazie danych</Error>)
                        setMyInputError(true)
                    } else {
                        const fromData = {
                            personalData: {
                                firstName: firstName
                            },
                            phoneNumber: phoneNumber,
                            email: email,
                            password: password,
                            role: role
                        }
                        axios.post('http://127.0.0.1:8080/user/signup', fromData)
                            .then(() => {
                                setError(<Error isAlternative={true}>Doda≈Çe≈õ pracownika</Error>)
                            })
                    }
                })
        }
    }
    return (
        <div>
            <MainSecondHeder>Dodaj pracownika</MainSecondHeder>
            {error}
            <form>
                <MyInput isError={isMyInputError}
                    type="text"
                    value={firstName}
                    placeholder="Wpisz Imiƒô"
                    onChange={(e) => {
                        setFirstName(e.target.value)
                        if (e.target.value === 0) {
                            setError(<Error>Podaj imiƒô</Error>)
                            setMyInputError(true)
                        } else {
                            setError("")
                            setMyInputError(false)
                        }
                    }} />
                <MyInput
                    isError={isMyInputErrorPhoneNumber}
                    type="text"
                    value={phoneNumber}
                    onChange={(e) => {
                        setPhoneNumber(e.target.value)
                        if (e.target.value.length === 0) {
                            setError(<Error>Wpisz numer telefonu</Error>);
                            setMyInputErrorPhoneNumber(true)
                            return
                        } else if (/\D/.test(e.target.value)) {
                            setError(<Error>Poda≈Çe≈õ b≈Çedny znak, wprowad≈∫ same cyfry</Error>)
                            setMyInputErrorPhoneNumber(true)
                            return
                        } else {
                            setError("");
                            setErrorStatus("");
                            setMyInputErrorPhoneNumber(false);
                        }
                    }}
                    placeholder="Numer kontaktowy" />
                <MyInput
                    isError={isMyInputErrorEmail}
                    type="text"
                    onChange={(e) => {
                        setEmail(e.target.value)
                        if (e.target.value.length === 0) {
                            setError(<Error>Podaj adres email</Error>)
                            setMyInputErrorEmail(true)
                        } else if ((!/^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}$/i.test(e.target.value))) {
                            setError(<Error>Wprowada≈∫ porpawny email</Error>);
                            setMyInputErrorEmail(true)
                            return
                        } else {
                            setError("");
                            setMyInputErrorEmail(false);
                            setErrorStatus("");
                        }
                    }}
                    value={email}
                    placeholder="emial" />
                <MyInput
                    isError={isMyInputErrorPassword}
                    type="password"
                    onChange={(e) => {
                        setPassword(e.target.value)
                        if (e.target.value.length === 0) {
                            setError("Wpisz has≈Ço");
                            setMyInputErrorPassword(true)
                        } else if (e.target.value.length < 6) {
                            setError(<Error>Has≈Ço musi zawieraƒá minimum 6 znak√≥w</Error>)
                        } else if (!/[!@#$%^&*()_+\-=[\]{};':"\\|,.<>/?]+/.test(e.target.value)) {
                            setError(<Error>Has≈Ço musi zawieraƒá znak specjalny np: @ ! # & % $</Error>)
                        } else if (!/^[^\s]*$/.test(e.target.value)) {
                            setError(<Error>Has≈Ço nie mo≈ºe zawieraƒá pustych znak√≥w</Error>)
                        } else {
                            setError("");
                            setMyInputErrorPassword(false);
                            setErrorStatus("");
                        }
                    }}
                    value={password}
                    placeholder="has≈Ço" />
                <MyInput
                    isError={isMyInputErrorPassword}
                    type="password"
                    onChange={(e) => {
                        setRepPassword(e.target.value)
                        if (e.target.value.length === 0) {
                            setError(<Error>Wpisz ponowine has≈Ço</Error>)
                            setMyInputErrorPassword(true)
                        } else if (password !== e.target.value) {
                            setError(<Error>Wpisane has≈Ça nie sƒÖ identyczne</Error>)
                            setMyInputErrorPassword(true)
                        } else {
                            setError("");
                            setMyInputErrorPassword(false);
                            setErrorStatus("");
                        }
                    }}
                    value={repPassword}
                    placeholder="powt√≥rz has≈Ço" />
                    <Button type='submit' onClick={(e)=>{
                         e.preventDefault();
                         registrationEmployee()
                    }}>Dodaj Pracownika</Button>

            </form>
        </div>
    )
}
